example.desc:
{%- macro printName(name) -%}
	 {{ "Hello " ~ name ~ "!\n" }}
{%- endmacro -%}
{{- powerjinja.array.for_each(["Anna", "Bob", "Claude"], printName) -}}
// prints:
// Hello Anna!
// Hello Bob!
// Hello Claude!

desc.desc:
Maps each item in array (first argument) to the result of a macro (second argument) executed with that item.
Note that mapping macro must implement following structure:
{%- macro my_macro(arg1=None, arg2=None, arg3=None, arg4=None, arg5=None, macros=[], index=0) -%}
	 // My mapping logic here...
  {{- handle_queue(result, arg2, arg3, arg4, arg5, macros, index) -}}
{%- endmacro -%}

example.desc:
{%- macro format_greeting(arg1=None, arg2=None, arg3=None, arg4=None, arg5=None, macros=[], index=0) -%}
	 {%- set greeting = "Hello" ~ arg1 ~ "!\n" -%}
  {{- handle_queue(greeting, arg2, arg3, arg4, arg5, macros, index) -}}
{%- endmacro -%}
{{- powerjinja.array.for_each(["Anna", "Bob", "Claude"], format_greeting, macros=[powerjinja.core.print]) -}}
// prints:
// Hello Anna!
// Hello Bob!
// Hello Claude!

{%- set obj = {"a": 1} -%}
{%- set prop = "b" -%}
{{- powerjinja.assert.object.has_property(obj, prop, macros=[powerjinja.core.print]) -}}
// prints False

{%- set obj = {"a": 1} -%}
{%- set prop = "a" -%}
{{- powerjinja.assert.object.has_property(obj, prop, macros=[powerjinja.core.print]) -}}
// prints True

{% macro test_macro %}{% endmacro %}
{{- powerjinja.assert.value.is_callable({'a': test_macro }, macros=[powerjinja.core.print]) -}}
// prints False

{% macro test_macro %}{% endmacro %}
{{- powerjinja.assert.value.is_callable(test_macro, macros=[powerjinja.core.print]) -}}
// prints True

{% set test_arr = [1, 2, 3] %}
{{- powerjinja.assert.value.is_empty(test_arr , macros=[powerjinja.core.print]) -}}
// prints False

{% set test_arr = [1, 2, 3] %}
{{- powerjinja.assert.value.is_empty(test_arr , macros=[powerjinja.core.print]) -}}
// prints True

{% macro test_macro %}{% endmacro %}
{{- powerjinja.assert.value.is_macro({'a': test_macro }, macros=[powerjinja.core.print]) -}}
// prints False

{% macro test_macro %}{% endmacro %}
{{- powerjinja.assert.value.is_macro(test_macro, macros=[powerjinja.core.print]) -}}
// prints True

{% set a = [] %}{% set b = [] %}
{{- powerjinja.assert.value.is_sameas(a, b, macros=[powerjinja.core.print]) -}}
// prints False

{% set a = [] %}{% set b = a %}
{{- powerjinja.assert.value.is_sameas(a, b, macros=[powerjinja.core.print]) -}}
// prints True

desc.desc:
This log supports numbers up to 4294967296 (2^32)
if/elif generated with:
var joined = '';
for(i = 1;i < 33; i++){
  joined += `{%elif arg1<` + Math.pow(2, i) + '%}{%set n='+ (i-1)+ '%}{%set d=' + Math.pow(2, i-1) + '%}\n';
}
joined += '{%endif%}';
console.log(joined)
